func TestCertificateVerifierSuite(t *testing.T) {
	suite.Run(t, new(CertificateVerifierSuite))
}

func (s *CertificateVerifierSuite) TestVerifyStandardCertificate() {
	s.Run("verify standard certificate", func() {
		retriever := SetUpCertificateRetriever()
		verifier := SetUpCertificateVerifier()
		subTests := []struct {
			name     string
			certHash string
			expected error
		}{
			{
				name:     "subtest_01",
				certHash: "4a28027238aa9b8047cead4782ffbbdd0b1b98545a0f3301bb152070c492cbd3",
				expected: nil,
			},
			{
				name:     "subtest_02",
				certHash: "30f23dfb0f1496ab523988709dd721cd5d60d7487dd40e1eb9f6ba3ba23c9b8a",
				expected: nil,
			},
		}

		for _, st := range subTests {
			s.Run(st.name, func() {
				newCert, err := retriever.GetCertificateDetails(st.certHash)
				if err != nil {
					s.Require().Equal(st.expected, err, st.name)
					return
				}
				previousCert, err := verifier.VerifyStandardCertificate(newCert, newCert.Signature.MultiSignature.ProtocolMultiSignature)
				if st.expected != nil {
					s.Require().Equal(st.expected, err, st.name)
				} else {
					s.Require().NoError(err, st.name)
					expectedPrevCert, err := retriever.GetCertificateDetails(newCert.PreviousHash)
					s.Require().NoError(err, st.name)
					s.Require().NotNil(previousCert)
					s.Require().Equal(expectedPrevCert, previousCert, st.name)
				}
			})
		}
	})
}

type MockCertificateRetriever struct{}

func (m *MockCertificateRetriever) GetCertificateDetails(hash string) (*Certificate, error) {
	for _, certProto := range certificates {
		if certProto.Hash == hash {
			cert, err := FromCertificateProto(&certProto)
			if err != nil {
				return nil, err
			}
			return cert, nil
		}
	}

	return nil, fmt.Errorf("invalid certificate hash: %v", hash)
}

func SetUpCertificateRetriever() *MockCertificateRetriever {
	return &MockCertificateRetriever{}
}

func SetUpCertificateVerifier() *MithrilCertificateVerifier {
	return &MithrilCertificateVerifier{
		CertificateRetriever: SetUpCertificateRetriever(),
	}
}
